import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
    {
        path: '/business/order',
        name: 'order',
        component: "@/components/Helloworld.vue"
    },
]

const router = new VueRouter({
    mode: 'history',
    routes: routes
})

export default router
